static void pack_and_write(const char *path, const int *bits, int nbits) {
    int nbytes = (nbits + 7) / 8;
    unsigned char *buf = calloc(nbytes, 1);
    if (!buf) {
        perror("calloc");
        return;
    }
    for (int i = 0; i < nbits; i++) {
        int byte = i >> 3;
        int bit  = 7 - (i & 7);
        if (bits[i]) buf[byte] |= (1 << bit);
    }
    FILE *f = fopen(path, "wb");
    if (!f) {
        perror(path);
        free(buf);
        return;
    }
    fwrite(buf, 1, nbytes, f);
    fclose(f);
    free(buf);
}

