    pack_and_write("data/s.bin",  s,   208);        // 26 bytes
    pack_and_write("data/Gt.bin", Gt, 208*160);     // 4160 bytes
    printf("Done: s.bin=26 bytes, Gt.bin=4160 bytes\n");
    return 0;
